```
const isEven = x => 0 === x % 2;
const isOdd = not<number>(isEven);
isOdd(1) // true
```

```
pushOrReplace<number>({
      match: x => x%2 === 0,
      replacement: 2
   },{
      match: x => x%3 === 0,
      replacement: 3
   })([1, 2, 4]) // [1, 2, 2, 3]
```

Using the chain
```
chain([1, 2, 4])
  .chain(pushOrReplace<number>({
      match: x => x%2 === 0,
      replacement: 2
   },{
      match: x => x%3 === 0,
      replacement: 3
   }))
  .value() // [1, 2, 2, 3]
```

